public boolean equals(Object e) {
  if (e == null || !(e instanceof PurgeElement)) {
    return false;
  }
  if (e == this) {
    return true;
  }
  PurgeElement el = (PurgeElement) e;
  return (this.message.equals(el.message))
      && (this.timestamp.equals(el.timestamp));
}
